import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import recommendation  from "./fetchrecommenddata";  
import Footer from "./Footer"; 


function Mymyrecommendation() {
    const myRecommendation = recommendation(); // Changed variable name to match the function name

    return (
        <>
            <Container>
                <br />
                <h1>Recommendation</h1>
                <Row>
                {myRecommendation.map((product) => (
        <Col key={product.id} sm={12} md={6} lg={4} xl={3}>
        <recommendationscreen product={product} /> {/* Pass product data as a prop */}
        </Col>
        ))}

                </Row>
            </Container>
            <Footer /> {/* Include Footer component here */}
        </>
    );
}

export default Mymyrecommendation;
